// https://jsonplaceholder.typicode.com/todos
import {useEffect, useState} from "react";



function Api() {
    const [data,setData]=useState(null)
    useEffect(()=>{
       fetch("https://jsonplaceholder.typicode.com/todos") 
       .then((res)=>{
        return res.json()
       })
       .then((resp)=>{
        console.log(resp)
        setData(resp)

       })
    })
    return (
        <div>
            <h1>Fetch Data From Backend</h1>
         
        </div>
    )
}
export default Api;
